/*
239. 滑动窗口最大值
给你一个整数数组 nums，有一个大小为 k 的滑动窗口从数组的最左侧移动到数组的最右侧。
你只可以看到在滑动窗口内的 k 个数字。滑动窗口每次只向右移动一位。
返回滑动窗口中的最大值。

示例 1：
	输入：nums = [1,3,-1,-3,5,3,6,7], k = 3
	输出：[3,3,5,5,6,7]
	解释：
		滑动窗口的位置                  最大值
		---------------               -----
		[1  3  -1] -3  5  3  6  7      3
		1 [3  -1  -3] 5  3  6  7       3
		1  3 [-1  -3  5] 3  6  7       5
		1  3  -1 [-3  5  3] 6  7       5
		1  3  -1  -3 [5  3  6] 7       6
		1  3  -1  -3  5 [3  6  7]      7

示例 2：									示例 3：
	输入：nums = [1], k = 1					输入：nums = [1,-1], k = 1
	输出：[1]								输出：[1,-1]

示例 4：									示例 5：
	输入：nums = [9,11], k = 2				输入：nums = [4,-2], k = 2
	输出：[11]								输出：[4]

提示：
		1 <= nums.length <= 10^5
		-10^4 <= nums[i] <= 10^4
		1 <= k <= nums.length
*/
/*
My Notes：
	提示里没说 k <= nums.length
	根据示例，输出数组out.length = nums.length - k + 1

	超时：有超长k的可能性
*/
package main

import "fmt"

func main() {
	test := []int{1, 3, -1, -3, 5, 3, 6, 7}
	fmt.Println(maxSlidingWindow(test, 3))
}

func maxSlidingWindow(nums []int, k int) []int {
	if k == 1 { //特殊情况A
		return nums
	}
	if k == len(nums) { //特殊情况B
		temp, _ := searchMax(nums[0], nums)
		return []int{temp}
	}

	out := make([]int, len(nums)-k+1)
	location := 0
	for i := 0; i < len(out); i++ {
		if location == 0 {
			out[i], location = searchMax(out[i-1], nums[i:i+k])
		}
		//TODO 未完成，
	}
	return out
}

func searchMax(firstMax int, nums []int) (max, where int) {
	if len(nums) == 1 {
		return nums[0], 0
	}
	max = firstMax
	where = 0
	for i := 1; i < len(nums); i++ {
		if max < nums[i] {
			max = nums[i]
			where = i
		}
	}
	return
}

